const Menu = () => {
  return (
    <nav>
      <NavLink className={({ isActiv }) => isActiv }
        to="."
        end
      >
        Home
      </NavLink>
      <NavLink to="about">About</NavLink>
      <NavLink to="contacts">Contacts</NavLink>
    </nav>
  );
};

export default Menu;
